import React from 'react';
import { BsPerson, BsPersonSlash } from 'react-icons/bs';

const Day = ({}) => {    
  const headerStyles = {
      backgroundColor: '#282c34',
      minHeight: '10vh',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      color: 'white',
  };    

  return (
    <h1>Day</h1>    
  );
};

export default Day;
